pragma solidity ^0.4.18;

import "zeppelin-solidity/contracts/ownership/Ownable.sol";
import "zeppelin-solidity/contracts/token/ERC20.sol";
import "./factories/ForecastingFactory.sol";
import "./factories/CrowdsaleFactory.sol";
import "./factories/RewardsModelFactory.sol";
import "./factories/DAOFactory.sol";
import "./interfaces/IUserStorage.sol";
import "./interfaces/IDAO.sol";
import "./helpers/Version.sol";

contract Wings is Ownable, Version {
    event WINGS_SETUP_FACTORIES(address userStorage, address crowdsale, address forecasting, address rewards, address token, address dao);
    event WINGS_DAO_ADD(address indexed dao);

    // Default wings anti-spam reserve amount
    uint256 wingsReserveAmount;

    // Wings anti-spam reserve amount for custom Crowdsale contract
    // TODO: review this (10000 ???)
    uint256 wingsReserveAmountForCustomCrowdsale;

    modifier isReady() {
        require(
            userStorage != address(0) &&
            crowdsaleFactory != address(0) &&
            forecastingFactory != address(0) &&
            rewardsModelFactory != address(0) &&
            tokenFactory != address(0) &&
            daoFactory != address(0)
        );
        _;
    }

    // DAOs
    mapping(bytes32 => address) daos;

    // DAOs ids
    mapping(uint => bytes32) daosIds;

    // User DAOs
    mapping(address => mapping(uint => bytes32)) myDAOsIds;
    mapping(address => uint) myDAOsCount;

    // Total number of DAOs
    uint public totalDAOsCount;

    // WINGS token
    ERC20 public token;

    // FR Storage
    IUserStorage public userStorage;

    // Factories
    CrowdsaleFactory public crowdsaleFactory;
    ForecastingFactory public forecastingFactory;
    RewardsModelFactory public rewardsModelFactory;
    TokenFactory public tokenFactory;
    DAOFactory public daoFactory;

    function Wings(
        address _token
    ) Version("1.0.0")
        public
    {
        token = ERC20(_token);
        owner = msg.sender;
    }

    // Sets up initial or new versions of FR storage and factories: strictly all in a single TX
    function setup(
        address _userStorage,
        address _crowdsaleFactory,
        address _forecastingFactory,
        address _rewardsModelFactory,
        address _tokenFactory,
        address _daoFactory,
        uint256 _frDecay1,
        uint256 _frDecay2,
        uint256 _frDecay3,
        uint256 _wingsReserveAmount,
        uint256 _wingsReserveAmountForCustomCrowdsale
    )
        public
        onlyOwner()
    {
        userStorage = IUserStorage(_userStorage);
        crowdsaleFactory = CrowdsaleFactory(_crowdsaleFactory);
        forecastingFactory = ForecastingFactory(_forecastingFactory);
        rewardsModelFactory = RewardsModelFactory(_rewardsModelFactory);
        tokenFactory = TokenFactory(_tokenFactory);
        daoFactory = DAOFactory(_daoFactory);
        wingsReserveAmount = _wingsReserveAmount;
        wingsReserveAmountForCustomCrowdsale = _wingsReserveAmountForCustomCrowdsale;

        require(userStorage.token() == address(token));
        require(userStorage.owner() == address(this));
        require(crowdsaleFactory.wings() == address(this));
        require(forecastingFactory.wings() == address(this));
        require(rewardsModelFactory.wings() == address(this));
        require(tokenFactory.wings() == address(this));
        require(daoFactory.wings() == address(this));

        userStorage.setupDecayParams(_frDecay1, _frDecay2, _frDecay3);

        WINGS_SETUP_FACTORIES(_userStorage, _crowdsaleFactory, _forecastingFactory, _rewardsModelFactory, _tokenFactory, _daoFactory);
    }

    function createDAO(
        string _name,
        string _tokenName,
        string _tokenSymbol,
        bytes32 _infoHash,
        address _customCrowdsale
    )
        public
        isReady()
    {
        uint256 reserveAmount = transferReserveAmount(msg.sender, (_customCrowdsale != address(0)));

        bytes32 daoId = sha256(_name);
        require(daos[daoId] == address(0));

        address dao = DAOFactory(daoFactory).create(
            _name,
            _tokenName,
            _tokenSymbol,
            address(this),  //manager
            msg.sender,     //owner
            daoId,
            _infoHash
        );

        require(token.transfer(dao, wingsReserveAmount));

        IDAO(dao).setupParameters(
            forecastingFactory,
            rewardsModelFactory,
            tokenFactory,
            crowdsaleFactory,
            _customCrowdsale,
            userStorage,
            reserveAmount
        );

        daos[daoId] = dao;
        daosIds[totalDAOsCount++] = daoId;
        myDAOsIds[msg.sender][myDAOsCount[msg.sender]++] = daoId;
        WINGS_DAO_ADD(dao);
    }

    function migrateFR(
        address _account,
        int32 _dFR
    )
        public
        onlyOwner()
        isReady()
    {
        userStorage.migrateFR(_account, _dFR);
    }

    function lockMigrations()
        public
        onlyOwner()
        isReady()
    {
        userStorage.lockMigrations();
    }

    // Wings owner is able to transfer all WINGS got stuck at this contract to any address
    function withdrawWings(address _destination)
        public
        onlyOwner()
    {
        require (_destination != address(0));
        uint256 balance = token.balanceOf(address(this));
        if (balance != 0) {
            require(token.transfer(_destination, balance));
        }
    }

    function addForecasterToDAO(bytes32 _daoId)
        public
        isReady()
    {
        address addr = daos[_daoId];
        require(addr != address(0));

        IDAO dao = IDAO(addr);
        IUserStorage(dao.userStorage()).addProject(msg.sender, dao.forecasting());
    }

    /*
      Get DAO by Id
    */
    function getDAOById(bytes32 _daoId) public constant returns (address _dao) {
        return daos[_daoId];
    }

    /*
      Get DAO Id by index
    */
    function getDAOId(uint _n) public constant returns (bytes32 _id) {
        return daosIds[_n];
    }

    /*
      Get user daos count
    */
    function getUserDAOsCount(address _user) public constant returns (uint _count) {
        return myDAOsCount[_user];
    }

    /*
      Get user daos id
    */
    function getUserDAOsId(address _user, uint _n) public constant returns (bytes32 _id) {
        return myDAOsIds[_user][_n];
    }

    // Transfer anti-spam reserve to this contract
    function transferReserveAmount(
        address _from,
        bool _isCustomCrowdsale
    )
        internal
        returns (uint256 reserveAmount)
    {
        reserveAmount = _isCustomCrowdsale ? wingsReserveAmountForCustomCrowdsale : wingsReserveAmount;
        uint256 allocated = token.allowance(_from, address(this));
        require(allocated >= reserveAmount);
        require(token.transferFrom(_from, address(this), reserveAmount));
    }
}
